Skeletons of Roman Ashkelon

History Documentary hosted by Qarie Marshall, published by Discovery Channel in 2001 - English narration


Information
------------------------------

On the shores of Israel's Mediterranean coast lay Ashkelon, a seaport since 3,500BC. It became one of the most important cities of the ancient world. The Romans conquered Ashkelon in 37BC and stayed for four centuries. 
Archaeologists have excavated here and the most surprising finding was a pit with numerous skeletons of newborn babies, thrown into the sewers beneath a Roman bathhouse. The investigations carried out are essential to unravel a mystery that has remained hidden for long. This program investigates a murder-mystery nearly two thousand years old.

Written and directed by Julia Harrington
Produced by Pioneer Productions For TLC

